import * as fs from 'node:fs';
import { promises as fsp } from 'node:fs';
import * as path from 'node:path';
import * as http from 'node:http';
import * as https from 'node:https';

export class DownloadXmls {
  constructor(protected dir: string, protected urls: string[]) {
  }

  async run(): Promise<void> {
    await this.ensureDir(this.dir);

    for (let i = 0; i < this.urls.length; i++) {
      const url = this.urls[i];
      let fileName = url.match(/\/download\/([^/]+)\/xml/)?.[1];
      if (!fileName) {
        console.error(`❌ Не беше взето файлово име от адреса ${url}`);
        continue;
      }
      fileName += '.xml';

      const filePath = path.join(this.dir, fileName);

      console.log(`#${this.urls.length - i}`);

      if (await this.fileExists(filePath)) {
        console.log(`⏭ Пропускам (вече съществува): ${fileName}`);
        continue;
      }

      await this.safeUnlink(filePath + '.part');

      try {
        console.log(`⬇ Свалям: ${fileName}`);
        await this.downloadToFile(url, filePath);
        console.log(`✅ Готово: ${fileName}`);
      } catch (err) {
        const msg = err instanceof Error ? err.message : String(err);
        console.error(`❌ Грешка при ${fileName}: ${msg}`);
      }
    }
  }

  private async ensureDir(dir: string): Promise<void> {
    await fsp.mkdir(dir, {recursive: true});
  }

  private async fileExists(p: string): Promise<boolean> {
    try {
      await fsp.access(p, fs.constants.F_OK);
      return true;
    } catch {
      return false;
    }
  }

  private async safeUnlink(p: string): Promise<void> {
    try {
      await fsp.unlink(p);
    } catch {
      // ignore
    }
  }

  private downloadToFile(
    url: string,
    destinationPath: string,
    maxRedirects = 5,
  ): Promise<void> {
    return new Promise((resolve, reject) => {
      const u = new URL(url);
      const proto = u.protocol === 'https:' ? https : http;

      const tempPath = destinationPath + '.part';

      const req = proto.get(u, (res) => {
        const status = res.statusCode ?? 0;

        // Redirect-и
        if ([301, 302, 303, 307, 308].includes(status)) {
          const location = res.headers.location;
          res.resume();

          if (!location) {
            return reject(new Error(`Redirect без Location за ${url}`));
          }
          if (maxRedirects <= 0) {
            return reject(new Error(`Твърде много redirect-и за ${url}`));
          }

          const nextUrl = new URL(location, u).toString();
          return this.downloadToFile(nextUrl, destinationPath, maxRedirects - 1)
            .then(resolve)
            .catch(reject);
        }

        if (status !== 200) {
          res.resume();
          return reject(new Error(`HTTP ${status} при ${url}`));
        }

        const fileStream = fs.createWriteStream(tempPath, {flags: 'wx'});

        fileStream.on('error', async (err) => {
          res.destroy();
          await this.safeUnlink(tempPath);
          reject(err);
        });

        res.on('error', async (err) => {
          fileStream.destroy();
          await this.safeUnlink(tempPath);
          reject(err);
        });

        res.pipe(fileStream);

        fileStream.on('finish', async () => {
          try {
            fileStream.close();
            await fsp.rename(tempPath, destinationPath);
            resolve();
          } catch (err) {
            await this.safeUnlink(tempPath);
            reject(err);
          }
        });
      });

      req.on('error', async (err) => {
        await this.safeUnlink(tempPath);
        reject(err);
      });

      // По желание:
      // req.setTimeout(60_000, () => req.destroy(new Error("Request timeout")));
    });
  }
}

